import React from 'react';

function RoomVisualizer({ roomData }) {
    const { dimensions, doorPlacement, windowPlacement } = roomData;

    return (
        <svg width={dimensions.width * 20} height={dimensions.length * 20}>
            {/* Draw room walls */}
            <rect x="0" y="0" width={dimensions.width * 20} height={dimensions.length * 20} fill="lightgrey" />

            {/* Draw door */}
            <rect x={doorPlacement.x * 20} y="0" width="20" height="10" fill="brown" />

            {/* Draw windows */}
            {windowPlacement.map((window, index) => (
                <rect key={index} x={window.x * 20} y={window.y * 20} width="10" height="10" fill="blue" />
            ))}
        </svg>
    );
}

export default RoomVisualizer;
